import React from "react";

export default function SlideComponent() {
  const list = [
    {
      id: 1,
      child: (
        <>
          Connnet On Facebook
          <img
            className="w-12"
            src="/Images/facebook.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      href: "https://www.facebook.com/pankajsingh.raikwal.3/",
      style: "rounded-br-md",
    },
    {
      id: 2,
      child: (
        <>
          Connnet On Instagram
          <img
            className="w-12"
            src="/Images/instagram.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      href: "https://www.instagram.com/",
    },
    {
      id: 3,
      child: (
        <>
          Connnet On LinkedIn
          <img
            className="w-12"
            src="/Images/linkedin.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      href: "https://www.linkedin.com/in/pankaj-singh-243155256/",
    },
    {
      id: 4,
      child: (
        <>
          Connnet On Twitter
          <img
            className="w-12"
            src="/Images/twitter.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      href: "https://twitter.com/i/flow/login?input_flow_data=%7B%22requested_variant%22%3A%22eyJsYW5nIjoiZW4ifQ%3D%3D%22%7D",
    },
    {
      id: 5,
      child: (
        <>
          Connnet On Email
          <img
            className="w-12"
            src="/Images/email.png"
            alt="MyHospitalWebApp"
          />
        </>
      ),
      href: "https://mail.google.com/mail/u/0/#inbox",
      style: "rounded-tr-md",
    },
  ];
  return (
    <div className="flex flex-col top-[3%] left-0 fixed">
      <ul>
        {list.map((item) => {
          return (
            <>
              <li
                key={item.id}
                className={
                  "flex justify-between items-center w-40 h-14 px-4  ml-[-100px] hover:ml-[-10px] hover:rounded-md duration-300 " +
                  " " +
                  item.style
                }
              >
                <a
                  href={item.href}
                  className="flex justify-between items-center w-full text-black"
                  target="_blank"
                >
                  {item.child}
                </a>
              </li>
              
            </>
          );
        })}
      </ul>
    </div>
